description:
?Seraphim falls? ar en psykologisk actionfilm som utspelar sig i slutet av det amerikanska inbordeskriget. Filmen handlar om en overste som ger sig ut pa jakt efter en man for att gora upp om en gammal oforratt fran kriget......  	 


Skadespelare:

Pierce Brosnan, Ed Lauter, Angie Harmon, Liam Neeson, Anjelica Huston, Xander Berkeley, Michael Wincott, Tom Noonan, Robert Baker, John Robinson, Kevin J. O&amp;#039;Connor,



Releasedatum:        2008-01-16


